1. webpack中使用1. webpack中使用
安装: 
通过npm在webpack项目中进行本地安装  
$ npm isntall sesame-http --save-dev
在webpack调试环境配置中配置devServer中的before(webpack@2.0版本为setup)
devServer:{
    before:(app)=>{
        sesame.setConfig({
              rulePath: path.join(__dirname,"./src/sesame.rule.js"), //绝对路径。项目所使用的拦截规则的具体文件，sesame-http会去引用这个文件  
              htmlContentPath:path.join(__dirname,"./src")           //绝对路径。如果使用文件形式的模拟数据形式，需要在此配置文件的根目录位置
        });
        sesame.webpack(app); //表示使用webpack中的app实例来取代sesame-http中的app实例
    }
}
关于模拟数据的具体方式请查看 模拟数据关于setConfig请查看 接口文档

mock/rule.html.body:
1. 规则形式sesame-http提供了两种模拟数据的形式。
规则形式（推荐 ）以及文件形式你可以根据项目需要来选择，也可以选择混合使用。  
1. 规则形式
类似于mock.js的语法规则首先你需要创建一个sesame.rule.js的文件，在其中写入相应的规则。并且可以在内部require其他的规则文件从而模块化  
语法 ：
sesame.mock(url,method,data);
url
@type: String@default:null@required: 必填@description:表示你需要拦截的请求    
method
@type: String@default: POST@required: 非必填，如果不填则第二个参数为data@description:表示需要拦截的请求方法，大小写均可。 可能的值 POST || GET || PUT || DELETE ...等  
data
@type: Object || Array || Function
@default:null@require:必填@description:表示需要返回的数据@return 如果为function对象时，返回指定的数据   

当该值为一个非function时，表示通过sesame解析该对象，并返回对应规则的json数据。 
具体解析规则见随机数据查看Demo..Todo
当该值为一个function时，sesame在拦截到对应的请求后会执行这个function，传入参数为请求对象（同express的request对象）。你可以根据请求对象来返回具体的数值。也可以通过调用sesame内置的函数来生成随机数。最后该函数需要返回一个数据，作为该请求的返回值。

例子：
sesame.mock("goform/getMyData","post",{
    id:{   //表示随机生成一个1~12的随机数
        $type:"number",
        range:[1,12]
    },
    ip:{   //表示随机生成一个ip  192.168.x.123  x为0~2
        $type:"ip",
        range:"192.168.0-2.123"
    }
});
//当匹配到post请求goform/getMyData时,返回如下数据  
{
    id:12,
    ip:"192.168.0.123"
}
查看更多Demo..Todo

random/random.html.body:
1. 随机数规则sesame提供了便捷的随机数生成方式   
前面我们有提到通过规则形式的请求sesame.mock(url,method,data);  
其中data为对象时在返回时会被sesame解析并生成随机数。data为函数时可以调用sesame.random来生成各种随机数。
1. 随机数规则

sesame会将带有$type的对象传入$type值的随机数生成器中。$type之外的属性则会作为参数传入生成器中。  

例:
sesame.mock("/goform/getMyData","post",{
    randomNumber:{
        $type:"number",
        range:[1,100]
    },
    randomIp:{
        $type:"ip",
        range:"192.168.0-1.1"
    },
    randomBool:{
        $type:"boolean",
        truePercent:80
    },
    array:[{
        $type:"number",
        range:[-100,0]
    },20],
    normal:{
        aa:"aa",
        cc:"bb"
    },
    other:1
});
那么当匹配到"/goform/getMyData"这个请求时，会返回一个对象  
{
    randomNumber: 11,     //一个1~100的随机数，每次返回值都不一样
    randomIp:192.168.0.1, //192.168.x.1  其中x为0~1
    randomBool:false,     //80%的概率返回true 20%概率返回false  
    array:[-50,20],       //数组中的对象能被正常解析
    normal:{              //对象内没有$type则不会被解析  
        aa:"aa",
        cc:"bb"
    },
    other:1               //不是对象也不会被解析  
}

random/random_type.html.body:
1. 根级属性2. 公共属性3. 随机数拓展3.1. boolean3.2. number3.3. float3.4. time3.5. array3.6. ip3.7. mask左上角有搜索按钮右上角有索引的哦~
sesame.mock(url,method,data);
1. 根级属性
只有当data为json对象或数组时，才需要进行解析。当json对象的第一层具有如下属性时。会做一个特殊处理  
$before:function(req){} 当具有$before属性时,在进入解析前，会先进入$before的函数，传入request对象。可以在这里对请求进行处理然后缓存数据。  
$response:"file" || "json" || "xml"  表示返回的类型，当为file时，需要额外配置$filePath来指定返回值的路径
$filePath:string || function   表示文件的绝对路径，当为function时，需要返回一个绝对路径  
$status:number   表示响应状态码例子：
sesame.rule.js  

let requestData,
requestUrl;
sesame.mock("gofor/getUser",{
    $before : (req)=>{
       requestData = req.body;//如果是get请求参数在req.params里
       requestUrl = req.originalUrl;
    },
    retData:()=>{
        return {
            data:requestData,
            from:requestUrl
        }
    }
})
2. 公共属性
$type:type  表示随机数的类型   
$pool:[]    当配置有$pool时，无论$type为何值,总是会优先从pool中选取一个值。如果想选取多个值，请使用array类型  
$include:regExp  输出不满足该正则表达式时重新随机。随机超过100次之后会报错。（todo）  
$exclude:regExp  输出满足该正则表达式时重新随机。如果同时配置了$include会需要同时满足两者。随机超过100次之后会报错（todo）
$store（todo）:  本地的储存空间，该对象不会被解析,在rule中可以通过this.$stroe来存取数据
3. 随机数拓展
如果你想拓展自己的随机数，请看这里 随机数拓展
3.1. boolean
随机生成一个布尔值 true或者false
参数truePercent:50@type: number  可以为浮点数@default: 50.00@description: 表示随机数中true的概率@check:  truePercent必须在[0,100]区间内，闭区间  
demo:
{
    boolean1:{
        $type:"boolean",
        truePercent:0         //必定为false
    },
    boolean2:{
        $type:"boolean",
        truePercent:40.223    //40.223%概率为true
    },
    boolean3:{
        $type:"boolean",
        truePercent:100       //100%为true
    }
}
3.2. number
随机生成一个整数参数:
range:[min,max]@type：Array@default:[1,100]
@length： 2 数组长度必须为2，否则报错
@description: 表示随机生成整数的范围，
@check:1.min必须小于等于max 2.min和max必须为整数  
demo:
{
    randomNumber:{
        $type:"number",
        range:[-100,-80]   
    },
    randomNumber2:{
        $type:"number",
        range:[-290,1399]    
    },
    randomNumber3:{
        $type:"number",
        range:[0,0]    
    }
}
3.3. float
随机生成一个浮点数参数  todo
3.4. time
随机生成一个指定格式的时间，或者时间戳参数 todo
3.5. array
随机生成一个数组参数length:[min,max] || length  ,表示数组随机的长度  min可以等于max@type : Array || Number || String     String会转成Number
@description:表示随机生成的数组的长度 
generator:function(){}@type:Function   返回一个随机值
@description:数组中的每一个成员都是通过调用该成员产生的
arrayPool:[] 
@type:Array@description:如果配置了该项，则generator会失效，数组中的成员会从这个数组中随机选取
poolRepeat:
@type:boolean@default:true   能够重复
@description:表示当arrayPool配置时，选取的元素是否能够重复@check: 当poolRepeat为false时，arrayPool的长度必须大于length中的最大值
3.6. ip
随机生成一个IPv4地址参数 
range:
@type:String    注意IP的range是一个字符串，与其余的range为数组不同@default:"0-255.0-255.0-255.0-255"
@description: 表示随机IP生成的范围，通过.分隔，-表示范围。
@check: 每一位ip都必须在[0,255]区间内，左右端点必须为数字。
demo:
